import React, {Component} from 'react';
import {connect} from 'react-redux';
import {bindActionCreators} from 'redux'
import {getDOWRequest, getDOWSuccess} from '../actions/dow';
import {Alert} from 'reactstrap';
import axios from 'axios'
import { FormGroup, Form, Button, Label, Input } from 'reactstrap';
import {useState} from 'react'

axios.defaults.baseURL = 'https://www.quandl.com/api/v3/datasets'


class App extends Component {
    constructor(props){
        super(props);
    }
    render(){
        console.log('items props:')
        console.log(this.props.items)
        return (
            <div style={{margin: '0 auto', padding: '20px', maxWidth: '600px'}}>
                <Button onClick = {() => this.props.getDOWRequest()}> Get DOW Quotes </Button>
            </div>
        );
    }
}

const mapStateToProps = state => {
  return {
    items: state.items
  };
};

const mapDispatchToProps = (dispatch) => {
  return bindActionCreators({getDOWRequest: getDOWRequest},dispatch);
};

export default connect(mapStateToProps, mapDispatchToProps)(App);
